import React from 'react';
import './toggleswitchbar_component.css'
import ToggleSwitchButton from '../toggleswitchbutton/toggleswitchbutton_component.js'
import { AppSearchContext } from '../../context/app/app_search_context';

const { paradigm, setSear } = useContext(AppSearchContext);

function ToggleSwitchBar(){
    return (
        <>
        <nav className="toggleswitchbar"> 
            <div className="toggleswitchbar-container">
            <ul>
                    <li><ToggleSwitchButton className="Album-btn" modality={"Album"} onclick={toggleSearchParadigmAlbum}/></li>
                    <li><ToggleSwitchButton className="Artist-btn" modality={"Artist"} onclick={toggleSearchParadigmArtist}/></li>
                    <li><ToggleSwitchButton className="Genre-btn" modality={"Genre"} onclick={toggleSearchParadigmGenre}/></li>
                    <li><ToggleSwitchButton className="Song-btn" modality={"Song"} onclick={toggleSearchParadigmSong}/></li>
                </ul>
            </div>
        </nav>
        </> 
    );
}



export default ToggleSwitchBar;
